// ==UserScript==
// @name         Kagi Highlight Search Box Text
// @namespace    http://tampermonkey.net/
// @author       Ryan-the-hito
// @version      1.1
// @description  Automatically highlights text from the search box of Kagi and supports infinite scrolling pages.
// @match        *://kagi.com/*
// @icon         data:image/png;base64,
// @license      MIT
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/530158/Kagi%20Highlight%20Search%20Box%20Text.user.js
// @updateURL https://update.greasyfork.org/scripts/530158/Kagi%20Highlight%20Search%20Box%20Text.meta.js
// ==/UserScript==

(function() {
    'use strict';

    let searchWords = ""; // 

    function highlightText() {
        if (!searchWords) return;
        const regex = new RegExp(`(${searchWords.split(/\s+/).join("|")})`, "gi");

        function processNode(node) {
            if (node.nodeType === 3) { // 
                const match = node.nodeValue.match(regex);
                if (match) {
                    const span = document.createElement("span");
                    span.innerHTML = node.nodeValue.replace(regex, '<mark>$1</mark>');
                    node.replaceWith(span);
                }
            } else if (node.nodeType === 1 && node.childNodes && !["SCRIPT", "STYLE", "NOSCRIPT", "MARK"].includes(node.tagName)) {
                node.childNodes.forEach(processNode);
            }
        }

        document.body.childNodes.forEach(processNode);
    }

    function getSearchQuery() {
        const searchBox = document.querySelector('input[type="search"], input[name="q"], textarea');
        return searchBox ? searchBox.value.trim() : "";
    }

    function updateKeywords() {
        const query = getSearchQuery();
        if (query && query !== searchWords) {
            searchWords = query;
            highlightText();
        }
    }

    // 
    function observeSearchBox() {
        const searchBox = document.querySelector('input[type="search"], input[name="q"], textarea');
        if (!searchBox) return;

        searchBox.addEventListener("input", () => {
            searchWords = searchBox.value.trim();
            highlightText();
        });
    }

    // 
    function observeDynamicContent() {
        const observer = new MutationObserver(() => {
            highlightText();
        });

        observer.observe(document.body, { childList: true, subtree: true });
    }

    // 
    setTimeout(() => {
        updateKeywords(); // 
        observeSearchBox(); // 
        observeDynamicContent(); // 
    }, 2000);
})();